import passportAuthsRouter from "./passportAuthsRouter.js";
import productsTestRouter from "./productsTestRouter.js";
import infoRouter from "./infoRouter.js";

export {passportAuthsRouter, productsTestRouter, infoRouter};

import mongoose from "mongoose";

const userSchema = mongoose.Schema({
  username: String,
  password: String,
});

export const User = mongoose.model("User", userSchema);

import pino from "pino";

const logger = pino("./logs/info.log", {
  level: "info",
  transport: {
    target: "pino-pretty",
    options: {
      translateTime: "SYS:dd-mm-yyyy HH:MM:ss",
      ignore: "pid,hostname",
      colorize: true,
    },
  },
});

export default logger;

const Authenticated=(req,res,next)=>{
  if (req.isAuthenticated()) 
      return res.render("home", { username: req.user.username });
  next()
}
export default Authenticated

